// src/components/Footer.jsx
import React from 'react';
import { Link } from 'react-router-dom';
import { Mail, Phone, MapPin, Twitter, Linkedin, Github, Instagram } from 'lucide-react';

const Footer = () => {
  return (
    <footer className="bg-black border-t border-gray-800 py-12">
      <div className="container mx-auto px-6">
        <div className="grid md:grid-cols-4 gap-12 mb-12">
          {/* Company Info */}
          <div>
            <div className="flex items-center space-x-3 mb-6">
              <div className="w-12 h-12 bg-gradient-to-r from-cyan-500 to-blue-600 rounded-xl flex items-center justify-center">
                <span className="text-white font-bold text-2xl">SE</span>
              </div>
              <div>
                <div className="text-2xl font-bold">SkyReti Educore</div>
                <div className="text-cyan-400 text-sm">Premium Edition</div>
              </div>
            </div>
            <p className="text-gray-400 mb-6">
              World's leading education & business management platform powered by AI.
            </p>
            <div className="flex space-x-4">
              {[Twitter, Linkedin, Github, Instagram].map((Icon, idx) => (
                <a 
                  key={idx} 
                  href="#" 
                  className="w-10 h-10 bg-gray-800 rounded-full flex items-center justify-center hover:bg-cyan-600 transition-colors"
                >
                  <Icon className="w-5 h-5" />
                </a>
              ))}
            </div>
          </div>
          
          {/* Quick Links */}
          {[
            {
              title: 'Platform',
              links: [
                { name: 'Features', path: '/features' },
                { name: 'Solutions', path: '/solutions/schools' },
                { name: 'Pricing', path: '/pricing' },
                { name: 'API Docs', path: '/resources' },
                { name: 'Status', path: '/dashboard' }
              ]
            },
            {
              title: 'Company',
              links: [
                { name: 'About Us', path: '/about' },
                { name: 'Careers', path: '/careers' },
                { name: 'Press', path: '/press' },
                { name: 'Partners', path: '/partners' },
                { name: 'Contact', path: '/contact' }
              ]
            },
            {
              title: 'Resources',
              links: [
                { name: 'Blog', path: '/blog' },
                { name: 'Webinars', path: '/webinars' },
                { name: 'Documentation', path: '/docs' },
                { name: 'Community', path: '/community' },
                { name: 'Support', path: '/support' }
              ]
            }
          ].map((column, idx) => (
            <div key={idx}>
              <h4 className="text-lg font-bold mb-6">{column.title}</h4>
              <ul className="space-y-3">
                {column.links.map((link, i) => (
                  <li key={i}>
                    <Link 
                      to={link.path} 
                      className="text-gray-400 hover:text-cyan-400 transition-colors"
                    >
                      {link.name}
                    </Link>
                  </li>
                ))}
              </ul>
            </div>
          ))}
        </div>
        
        {/* Contact Info */}
        <div className="border-t border-gray-800 pt-8 mb-8">
          <div className="grid md:grid-cols-3 gap-6">
            <div className="flex items-center">
              <Mail className="w-5 h-5 text-cyan-400 mr-3" />
              <span className="text-gray-400">contact@skyretieducore.com</span>
            </div>
            <div className="flex items-center">
              <Phone className="w-5 h-5 text-cyan-400 mr-3" />
              <span className="text-gray-400">+1 (555) 123-4567</span>
            </div>
            <div className="flex items-center">
              <MapPin className="w-5 h-5 text-cyan-400 mr-3" />
              <span className="text-gray-400">San Francisco, CA</span>
            </div>
          </div>
        </div>
        
        {/* Bottom Bar */}
        <div className="border-t border-gray-800 pt-8 flex flex-col md:flex-row justify-between items-center">
          <div className="text-gray-500 mb-4 md:mb-0">
            Â© 2025 SkyReti Educore. All rights reserved.
          </div>
          <div className="flex space-x-6 text-gray-400">
            <Link to="/terms" className="hover:text-white">Privacy Policy</Link>
            <Link to="/privacy" className="hover:text-white">Terms of Service</Link>
            <Link to="/cookies" className="hover:text-white">Cookie Policy</Link>
            <Link to="/gdpr" className="hover:text-white">GDPR</Link>
          </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
